d = sid === SIDs[i] &amp;&amp; sample_id === sample_ids[i];\n                            break;\n                        case 24: // \"011000\" \u306e\u5834\u5408\n                            isMatched = sample_id === sample_ids[i] &amp;&amp; figure_id === figure_ids[i];\n                            break;\n                        case 32: // \"100000\" \u306e\u5834\u5408\n                            isMatched = sid === SIDs[i];\n                            break;\n                        case 16: // \"010000\" \u306e\u5834\u5408\n                            isMatched = figure_id === figure_ids[i];\n                            break;\n                        case 8: // \"001000\" \u306e\u5834\u5408\n                            isMatched = sample_id === sample_ids[i];\n                            break;\n                        case 4: // \"000100\" \u306e\u5834\u5408\n                            isMatched = compositions[i].indexOf(composition) !== -1\n                            break\n                        case 2: // \"000010\" \u306e\u5834\u5408\n                            isMatched = elements.every(function(element) {\n                                return formulas[i].includes(element);\n                            });\n                            break\n                        case 1: // \"000001\" \u306e\u5834\u5408\n                            isMatched = elements.every(function(element) {\n                                return formulas[i].includes(element);\n                            });\n                            if (isMatched) {\n                                isMatched = formulas[i].split(' ').length === elements.length\n                            }\n                            break\n                    }\n                    if (isMatched) {\n                        pushMatchedData(i);\n                    } else {\n                        pushUnmatchedData(i);\n                    }\n                }\n\n                // Update the data sou
